import React from 'react'

class ClickEvent extends React.Component{

    render(){
        return (
            alert('Hello')
        );
    }
}

class ActionButton extends React.Component{

    render(){
        return (
            <button onClick={ClickEvent} name="" >
            Click Me
            </button>
        );
    }
}

export default ActionButton;
